import React from "react";
import styled from "styled-components";
import { darken, lighten } from 'polished';
import StuCircle from "../atoms/StuCircle";
import { StudProvider } from "../../Context/StudProvider";
import Size from "../../Size";
import { FiChevronLeft } from "react-icons/fi";
import { FiChevronRight } from "react-icons/fi";

const ButtonBox = styled.div`
display: inline-block;
vertical-align: middle;
width: 105.23px;
height: 24px;
padding-left: 0%;
padding-top: 470px;
`;

const StudBox = styled.div`
display: inline-block;
vertical-align: middle;
  width: 848px;
  padding-top: 72px;
  padding-left: 12.56015625%;

  position: relative;
  overflow: hidden;
  @media screen and ${Size.device.tablet} {
    width: 608px;
    padding-top: 56px;
    padding-left: 0%;
    height: 50%;
  }
  @media screen and ${Size.device.moblie} {
    width: 303px;

    padding-top: 54px;
    padding-left: 0%;
  }
`;




function Student() {
  return (
    <>
    <ButtonBox><FiChevronLeft size="50" color="#C4C4C4"/><FiChevronRight size="50" color="#C4C4C4"/></ButtonBox>
    <StudBox>
      <StudProvider>
        <StuCircle />
      </StudProvider>
    </StudBox>
    </>
  );
}

export default Student;
